import React from "react";

import students from "../assets/data/student.json";

const Kurs = () => {
 

  return (
    <div>
      <h1>KURSIYERLER</h1>

      <h3>Yasi 25`den buyuk olanlar ;</h3>

      {students.student
        .filter((student) => student.yas > 25)
        .map((student, index) => {
        

        return (
            <ul key={index}>
              <li>{ student.isim}</li>
            </ul>
          )
 } )}
    </div>
  );
};

export default Kurs;
